import React from "react";
import "./App.css";

const Card = props => {
  return fetch("https://github-dependents.glitch.me/facebook/react?limit=1")
    .then(response => response.json())
    .then(data => {
      console.log(data.totalDependants);
      return data.totalDependants;
    })
    .catch(error => console.error(error));
};

function App() {
  return (
    <div className="App">
      <Card />
      <header className="App-header">
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Used by
        </a>
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
      </header>
    </div>
  );
}

export default App;
